import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Outlet,
} from "react-router-dom"
import { Home } from "./pages/Home/Home";
import { Products } from "./pages/Products/Products";
import { Product } from "./pages/Product/Product";
import { Blog } from "./pages/Blog/Blog";
import Navbar from "./components/navbar/Navbar";
import Footer from "./components/footer/Footer";

const Layout = () => {
  return (
    <div className="app">
      <Navbar/>
      <Outlet/>
      <Footer/>
    </div>
  )
}

const router = createBrowserRouter([
  {
    path:"/",
    element:<Layout/>,
    children : [
      {
        path:"/",
        element:<Home/>
      },
      {
        path:"/products/:id",
        element:<Products/>
      },
      {
        path:"/product/:id",
        element:<Product/>
      },
      {
        path:"/blog/:id",
        element:<Blog/>
      },
      {
        path:"/blog/:id",
        element:<Blog/>
      },
      {
        path:"/blog/:id",
        element:<Blog/>
      },
    ]
  },

])

function App() {
  return <div>
    <RouterProvider router={router}/>
  </div>;
}

export default App;
